CREATE PROC [dbo].[usp_BrandOperatorRestaurants_GetAll]ASSET NOCOUNT ONSELECT [Id], 	[BrandId], 	[OperatorId], 	[RestaurantId], 	[StartDate], 	[EndDate], 	[Comments], 	[IsActive], 	[CreatedAt], 	[CreatedBy], 	[UpdatedAt], 	[UpdatedBy], 	[DeletedAt], 	[DeletedBy]FROM [dbo].[BrandOperatorRestaurants] WITH(NOLOCK)